// Parent - Main.js

import React from "react";

import Box from "@mui/material/Box";
import Skeleton from "@mui/material/Skeleton";

import classes from "../../ui/SwiperSlideUI.module.css";

function BodySkeleton() {
  return (
    <div>
        <Skeleton
          height={250}
          width="19%"
          sx={{ display: "inline-block", mr: 3 }}
          animation="wave"
          variant="rectangular"
        />

      <Box sx={{ display: "inline" }}>
        <Skeleton
          height={250}
          width="19%"
          sx={{ display: "inline-block", mr: 3 }}
          animation="wave"
          variant="rectangular"
        />
      </Box>
      <Box sx={{ display: "inline" }}>
        <Skeleton
          height={250}
          width="19%"
          sx={{ display: "inline-block", mr: 3 }}
          animation="wave"
          variant="rectangular"
        />
      </Box>
      <Box sx={{ display: "inline" }}>
        <Skeleton
          height={250}
          width="19%"
          sx={{ display: "inline-block", mr: 3 }}
          animation="wave"
          variant="rectangular"
        />
      </Box>
      <Box sx={{ display: "inline" }}>
        <Skeleton
          height={250}
          width="19%"
          sx={{ display: "inline-block"}}
          animation="wave"
          variant="rectangular"
        />
      </Box>
    </div>
  );
}

export default BodySkeleton;
